(6, 10, 4, '', 'o-que-e-twing-664dc66a1529d', 'O que é Twing?', 'A relação do homem com o meio ambiente vem mudando ao longo do tempo. No passado tinha-se uma visão utilitarista do meio ambiente, do qual se extraia os recursos para sua sobrevivência. Após a Revolução industrial prejuízos ambientais começaram a ser vistos decorrentes das formas de produção e consumo.', 1, 1, '2024-05-22 12:43:00', 1, '2024-05-10 00:41:31', '2024-05-23 20:05:21'),
