(18, 1, 6, '', 'identificacao-e-segmentacao-do-mercado-alvo', 'Identificação e Segmentação do Mercado Alvo ', 'Usualmente uma organização não é capaz de satisfazer as necessidades de todos os potenciais clientes de forma análoga, pelo que estes devem ser divididos em segmentos homogéneos que sejam diferentes entre si. ', 1, 11, '2024-06-07 20:28:46', 1, '2024-05-22 11:55:05', '2024-05-23 20:05:21'),
